import { Link } from 'react-router-dom';
import '../style/navbar.css'

function Navbar() {
 return (
  <nav className='nav-bar'>
    <ul>
      <li>
        <Link to='/movimentation'>Inserir movimentações de carteira</Link>
      </li>
    </ul>
  </nav>
 );
}

export default Navbar;
